Cell[BoxData[
 RowBox[{
  RowBox[{"(*", " ", 
   RowBox[{"writing", " ", "as", " ", "JSON"}], " ", "*)"}], 
  "\[IndentingNewLine]", 
  RowBox[{
   RowBox[{"makeJsonObject", "[", 
    RowBox[{"fields_", ",", "parameters_", ",", "results_"}], "]"}], ":=", 
   RowBox[{"Module", "[", 
    RowBox[{
     RowBox[{"{", 
      RowBox[{
      "fieldsJson", ",", "matrixElementsJson", ",", "toString", ",", 
       "getRelevantParameters", ",", "replaceSpecials"}], "}"}], ",", 
     RowBox[{"(*", 
      RowBox[{
      "construct", " ", "an", " ", "object", " ", "which", " ", "can", " ", 
       "then", " ", "be", " ", "exported", " ", "to", " ", "JSON"}], "*)"}], 
     RowBox[{
      RowBox[{
       RowBox[{"toString", "[", "arg_", "]"}], ":=", 
       RowBox[{"If", "[", 
        RowBox[{
         RowBox[{"StringQ", "[", "arg", "]"}], ",", "arg", ",", 
         RowBox[{"ToString", "[", 
          RowBox[{"arg", ",", "InputForm"}], "]"}]}], "]"}]}], ";", 
      "\[IndentingNewLine]", 
      RowBox[{"(*", " ", 
       RowBox[{"StringReplace", "[", 
        RowBox[{"...", ",", 
         RowBox[{"{", 
          RowBox[{
           RowBox[{"RegularExpression", "[", "\"\<(\\\\W)s\>\"", "]"}], "->", 
           "\"\<_s\>\""}], "}"}]}], "]"}], " ", "*)"}], "\[IndentingNewLine]", 
      RowBox[{
       RowBox[{"replaceSpecials", "[", "arg_", "]"}], ":=", 
       RowBox[{"arg", "/.", 
        RowBox[{"{", 
         RowBox[{
          RowBox[{"Pi", "->", "_pi"}], ",", 
          RowBox[{"s", "->", "_s"}], ",", 
          RowBox[{"t", "->", "_t"}], ",", 
          RowBox[{"u", "->", "_u"}]}], "}"}]}]}], ";", "\[IndentingNewLine]", 
      
      RowBox[{
       RowBox[{"getRelevantParameters", "[", "arg_", "]"}], ":=", 
       RowBox[{"Select", "[", 
        RowBox[{"parameters", ",", 
         RowBox[{
          RowBox[{"Not", "[", 
           RowBox[{"FreeQ", "[", 
            RowBox[{"arg", ",", "#"}], "]"}], "]"}], "&"}]}], "]"}]}], ";", 
      "\[IndentingNewLine]", 
      RowBox[{"fieldsJson", "=", 
       RowBox[{"Table", "[", 
        RowBox[{
         RowBox[{"{", 
          RowBox[{
           RowBox[{"\"\<index\>\"", "->", 
            RowBox[{"i", "-", "1"}]}], ",", 
