            RowBox[{"toString", "[", 
             RowBox[{"fields", "[", 
              RowBox[{"[", "i", "]"}], "]"}], "]"}]}]}], "}"}], ",", 
         RowBox[{"{", 
          RowBox[{"i", ",", "1", ",", 
           RowBox[{"Length", "[", "fields", "]"}]}], "}"}]}], "]"}]}], ";", 
      "\[IndentingNewLine]", 
      RowBox[{"matrixElementsJson", "=", 
