               RowBox[{"[", "1", "]"}], "]"}]}], "/.", 
             RowBox[{
              RowBox[{"M", "[", "a__", "]"}], "->", 
              RowBox[{"List", "[", "a", "]"}]}]}], ",", 
            RowBox[{"\"\<parameters\>\"", "->", 
             RowBox[{"Map", "[", 
              RowBox[{"toString", ",", 
               RowBox[{"getRelevantParameters", "[", 
                RowBox[{"#", "[", 
                 RowBox[{"[", "2", "]"}], "]"}], "]"}]}], "]"}]}], ",", 
            RowBox[{"\"\<expression\>\"", "->", 
             RowBox[{"toString", "[", 
              RowBox[{"replaceSpecials", "[", 
               RowBox[{"#", "[", 
                RowBox[{"[", "2", "]"}], "]"}], "]"}], "]"}]}]}], "}"}], 
          "&"}], ",", "results"}], "]"}]}], ";", "\[IndentingNewLine]", 
      RowBox[{"Return", "[", 
